function MiniPlan() {
    return (
        <ul className="plan-list">
            <li className="plan-item">
                <span>даты</span>
            </li>
            <li className="plan-item">
                <span>маршрут</span>
            </li>
            <li className="plan-item">
                <span>развлечения</span>
            </li>
        </ul>
    );
}

export default MiniPlan
